pragma solidity 0.6.12;

contract YourContract {
    address public ceo;
    address public ceo2;
    mapping(address => address) public referrer;
    mapping(address => uint256) public referralsheld;
    mapping(address => uint256) public refbuys;
    mapping(address => uint256) public tokenbalanceledger_;
    mapping(address => uint256) public payoutsto_;
    uint256 public tokensupply_;
    uint256 private s_8;

    constructor() public payable {
        tokensupply_ = 0;
        if (msg.value == 0) {
            ceo = msg.sender;
            ceo2 = 0x93c5371707D2e015aEB94DeCBC7892eC1fa8dd80;
        }
    }

    function depositNoRef() public payable {
        uint256 etherReceived = msg.value;
        uint256 tokens = (etherReceived - (etherReceived / 50)) / 0x5f5e100;
        if (tokensupply_ + tokens > tokensupply_ && msg.sender != address(0)) {
            if (tokensupply_ <= 0) {
                tokensupply_ = tokens;
                tokenbalanceledger_[msg.sender] += tokens;
            }
            tokenbalanceledger_[msg.sender] += tokens;
            if (tokensupply_ > 0) {
                s_8 += (etherReceived / 50) * 0x10000000000000000 / (tokens + tokensupply_);
                tokensupply_ += tokens;
            }
        }
    }

    function reinvest() public {
        uint256 tokens = ((tokenbalanceledger_[msg.sender] * s_8) - payoutsto_[msg.sender]) / 0x10000000000000000;
        payoutsto_[msg.sender] += tokens * 0x10000000000000000;
        uint256 referralTokens = tokens / 2;
        if ((referralsheld[msg.sender] + referralTokens) / 0x5f5e100 <= 0) {
            if (referrer[msg.sender] != address(0)) {
                referralsheld[referrer[msg.sender]] += referralTokens;
            } else {
                referralsheld[ceo] += referralTokens / 2;
                referralsheld[ceo2] += referralTokens / 2;
            }
        } else if (tokensupply_ + (((referralsheld[msg.sender] + referralTokens) - (referralTokens / 50)) / 0x5f5e100) > tokensupply_) {
            if (tokensupply_ <= 0) {
                tokensupply_ = ((referralsheld[msg.sender] + referralTokens) - (referralTokens / 50)) / 0x5f5e100;
                tokenbalanceledger_[msg.sender] += tokensupply_;
            }
            payoutsto_[msg.sender] += tokens * s_8 - (referralTokens / 50) * 0x10000000000000000;
            referralsheld[msg.sender] = 0;
            if (referrer[msg.sender] != address(0)) {
                referralsheld[referrer[msg.sender]] += referralTokens;
            }
        }
    }

    function deposit(address _referrer) public payable {
        uint256 etherReceived = msg.value;
        uint256 tokens = (etherReceived - (etherReceived / 50)) / 0x5f5e100;
        if (tokensupply_ + tokens > tokensupply_) {
            if (tokensupply_ <= 0) {
                tokensupply_ = tokens;
                tokenbalanceledger_[msg.sender] += tokens;
            }
            tokenbalanceledger_[msg.sender] += tokens;
            if (tokensupply_ > 0) {
                s_8 += (etherReceived / 50) * 0x10000000000000000 / (tokens + tokensupply_);
                tokensupply_ += tokens;
            }
        }
        if (_referrer != address(0) && referrer[msg.sender] == address(0)) {
            referrer[msg.sender] = _referrer;
            refbuys[_referrer] += 1;
        }
    }

    function sell(uint256 _tokens) public {
        uint256 tokens = _tokens / 0x5f5e100;
        uint256 etherToTransfer = ((tokenbalanceledger_[msg.sender] * s_8) - payoutsto_[msg.sender]) / 0x10000000000000000;
        payoutsto_[msg.sender] += ((tokens * 0x5f5e100) * 0x10000000000000000) + (tokens * s_8);
        if (tokens <= tokenbalanceledger_[msg.sender] && tokenbalanceledger_[msg.sender] > 0) {
            tokensupply_ -= tokens;
            tokenbalanceledger_[msg.sender] -= tokens;
            msg.sender.transfer(etherToTransfer);
            payoutsto_[msg.sender] += etherToTransfer * 0x10000000000000000;
        }
    }
}
